import React, { Component } from 'react';
import { Route } from 'react-router-dom';

import {A} from './pages/Home';
import {B} from './pages/About';



class App extends Component {
    render() {
        return (
            <div>
                <Route exact path="/" component={A}/>
                <Route path="/about" component={B}/>
            </div>
        );
    }
}

export default App;
